import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import VideoRoom from "./Room";
function Home() {
  const [roomId, setRoomId] = useState(""); // Initialize roomId with an empty string
  const navigate=useNavigate()
  const handleJoin = () => {
    
    navigate(`/room/${roomId}`);
    {roomId && <VideoRoom />}
  };

  return (
    <main>
      <h1>Zeocloud Video Streaming App</h1>
      <input
        type="text"
        placeholder="Enter room Id"
        value={roomId}
        onChange={(e) => setRoomId(e.target.value)} // Update roomId when the input value changes
      />
      <button onClick={handleJoin}>Join</button>
      {roomId && <VideoRoom />}
    </main>
  );
}

export default Home;
